function hexToRgb(t){var e=/^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(t);return"rgb("+parseInt(e[1],16)+","+parseInt(e[2],16)+","+parseInt(e[3],16)+")"}function adjustTextToBackground(t){var e=$(t).css("background-color");e=e.split(",");var a=parseInt(e[0].split("(")[1])/255,n=parseInt(e[1])/255,o=parseInt(e[2].split(")")[0])/255;return(Math.max(a,n,o)+Math.min(a,n,o))/2>=.5?$(t).css("color","black"):$(t).css("color","white")}$(document).ready((function(){$(".adjust-text").length&&$(".adjust-text").each((function(){adjustTextToBackground(this)}))})),$(document).on("click",".cookies-container button.agree",(function(t){$.ajaxSetup({headers:{"X-CSRF-TOKEN":$('meta[name="csrf-token"]').attr("content")}}),$.ajax({type:"get",url:"/cookies",timeout:1e4,complete:function(){$(".cookies-wrapper").hide()}})}));